- input: "TEXT\x1CC00348607\x1CX0\x1C\x1CF3XA\x1CThe following memo is in response
    to your letter dated September 30, 2009.  As the Commission recognized in Advisory
    Opinion 2004-20 and Advisory Opinion 1976-58, Connecticut law provides for three
    separate U.S. Senate elections in 2010.  The first is a convention to be held
    in May 2010 which has authority to nominate a candidate, and which is commonly
    regarded as the primary.  The second is a subsequent primary election which will
    be held in August 2010, if the May 2010 convention fails to nominate a candidate.
    \ The third is the November 2010 general election.  See Advisory Opinion 2004-20.
    \   The Committee made contributions for each of these separate elections, and
    hence has not exceeded its limits. The Committee has amended the attached July
    Monthly Report to clarify that it?s most recent contribution was made for the
    August 2010 primary.    If you have further questions about this matter, please
    do not hesitate to contact the Committee.    \n"
